import React from "react";

import "./settingAccount.css";
import person from "../images/person.jpg";
import { useNavigate } from "react-router-dom";

const SettingAccount = () => {
  const navigate = useNavigate();

  const changePassword = () => {
    navigate("change-password");
  };
  return (
    <div className="setting-store setting-account">
      <button className="log-out">تسجيل الخروج</button>
      <button className="change-password" onClick={changePassword}>
        تغيير كلمة المرور
      </button>
      <h1 className="title-dashboard">إعدادات الحساب</h1>
      <div>
        <div className="logo person">
          <img src={person} alt="person" />
          <div>
            <i class="fa-solid fa-camera-rotate"></i>
          </div>
        </div>
        <form>
          <label>
            الاسم
            <input type="text" value={`علي شاهين`} />
          </label>
          <label>
            الهاتف
            <input type="text" value={`+21325425485`} />
          </label>
          <label>
            البريد الإلكتروني
            <input type="text" value={`larab@gmail.com`} />
          </label>
          <input type="submit" value="حفظ" />
        </form>
      </div>
    </div>
  );
};

export default SettingAccount;
